import React from 'react';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import Grid from '@mui/material/Grid';
import { Grid2 } from '@mui/material';

function TestPage() {
  return (
    <div>
      <Box sx={{ p: 2, width: { xs: '100%', md: '100%', lg: '80%' }, margin: 'auto' }}>
        
        {/* First Stack with two Grids for Profile and Name */}
        <Stack direction="row" spacing={2} sx={{ mb: 2 }}>
          <Grid2 container spacing={2} alignItems="center">
            
            {/* Profile Grid */}
            <Grid2 item xs={3}>
            <img 
                  src="https://vehiclemaintenance.blob.core.windows.net/profilepics/logo.png" 
                  alt="Profile" 
                  style={{ width: '100%', height: '100%', objectFit: 'cover' }} // Fill the circle
                />
            </Grid2>

            {/* Name Grid */}
            <Grid2 item xs={9} sx={{ textAlign: 'left' }}>
              <Box><strong>John Doe</strong></Box>
            </Grid2>
          </Grid2>
        </Stack>

        {/* Second Stack */}
        <Stack direction="row" spacing={2}>
          <Button variant="text">Button 3</Button>
          <Button variant="contained">Button 4</Button>
        </Stack>
      </Box>
    </div>
  );
}

export default TestPage;
